import React from "react";

const Footer = () => {
  return (
    <div className="footer-Container">
      <div className="container">
        <ul>
          <li>FACEBOOK</li>
          <li>INSTAGRAM</li>
          <li>LINE@</li>
          <li>Email us at alex02081@icloud.com</li>
        </ul>
        <ul>
          <img src={"/imags/footerlogo.png"} alt="" />
        </ul>
      </div>
    </div>
  );
};

export default Footer;
